import React, { useState, useEffect } from "react";
import "./Header.css";
const Header = () => {
  // Initialize state based on localStorage
  const [isDarkMode, setIsDarkMode] = useState(() => {
    const savedTheme = localStorage.getItem("theme");
    return savedTheme === "dark";
  });

  useEffect(() => {
    // Apply theme class to body based on state
    document.body.classList.toggle("dark-theme", isDarkMode);
    document.body.classList.toggle("light-theme", !isDarkMode);

    // Save the current theme in localStorage
    localStorage.setItem("theme", isDarkMode ? "dark" : "light");
  }, [isDarkMode]);

  const themeToggle = () => {
    setIsDarkMode((prevMode) => !prevMode);
  };
  // const handleAboutClick = () => {
  //   if (aboutSectionRef && aboutSectionRef.current) {
  //     aboutSectionRef.current.scrollIntoView({ behavior: "smooth" });
  //   }
  // };

  return (
    <>
      <div className="main">
        <img
          src="https://logos.textgiraffe.com/logos/logo-name/Ayesha-designstyle-pastel-m.png"
          alt="Logo"
          className="logo"
        />
        <nav>
          <div className="nav-links">
            <ul>
              <li>
                <a href="#home"> Home </a>
              </li>
              <li>
                <a href="#about"> About </a>
              </li>
              <li>
                <a href="#products"> Products </a>
              </li>
              <li>
                <a href="#team"> Team </a>
              </li>
              <li>
                <a href="#service"> Service </a>
              </li>
              <li>
                <a href="#resources"> Resources </a>
              </li>{" "}
              <li>
                <a href="#contact"> Contact </a>
              </li>
            </ul>
          </div>
          <div className="nav-buttons">
            <div className="all">
              <input
                type="checkbox"
                className="theme-checkbox"
                id="theme-checkbox"
                onChange={themeToggle}
                checked={isDarkMode}
              />
              <label
                htmlFor="theme-checkbox"
                className="label"
                title="Dark Mode On/Off"
              >
                <svg
                  xmlns="http://www.w3.org/2000/svg"
                  width="10"
                  height="10"
                  fill="currentColor"
                  className="bi bi-sun"
                  viewBox="0 0 16 16"
                >
                  <path d="M8 11a3 3 0 1 1 0-6 3 3 0 0 1 0 6zm0 1a4 4 0 1 0 0-8 4 4 0 0 0 0 8zM8 0a.5.5 0 0 1 .5.5v2a.5.5 0 0 1-1 0v-2A.5.5 0 0 1 8 0zm0 13a.5.5 0 0 1 .5.5v2a.5.5 0 0 1-1 0v-2A.5.5 0 0 1 8 13zm8-5a.5.5 0 0 1-.5.5h-2a.5.5 0 0 1 0-1h2a.5.5 0 0 1 .5.5zM3 8a.5.5 0 0 1-.5.5h-2a.5.5 0 0 1 0-1h2A.5.5 0 0 1 3 8zm10.657-5.657a.5.5 0 0 1 0 .707l-1.414 1.415a.5.5 0 1 1-.707-.708l1.414-1.414a.5.5 0 0 1 .707 0zm-9.193 9.193a.5.5 0 0 1 0 .707L3.05 13.657a.5.5 0 0 1-.707-.707l1.414-1.414a.5.5 0 0 1 .707 0zm9.193 2.121a.5.5 0 0 1-.707 0l-1.414-1.414a.5.5 0 0 1 .707-.707l1.414 1.414a.5.5 0 0 1 0 .707zM4.464 4.465a.5.5 0 0 1-.707 0L2.343 3.05a.5.5 0 1 1 .707-.707l1.414 1.414a.5.5 0 0 1 0 .708z"></path>
                </svg>
                <svg
                  xmlns="http://www.w3.org/2000/svg"
                  width="8"
                  height="10"
                  fill="currentColor"
                  className="bi bi-moon"
                  viewBox="0 0 16 16"
                >
                  <path d="M6 .278a.768.768 0 0 1 .08.858 7.208 7.208 0 0 0-.878 3.46c0 4.021 3.278 7.277 7.318 7.277.527 0 1.04-.055 1.533-.16a.787.787 0 0 1 .81.316.733.733 0 0 1-.031.893A8.349 8.349 0 0 1 8.344 16C3.734 16 0 12.286 0 7.71 0 4.266 2.114 1.312 5.124.06A.752.752 0 0 1 6 .278zM4.858 1.311A7.269 7.269 0 0 0 1.025 7.71c0 4.02 3.279 7.276 7.319 7.276a7.316 7.316 0 0 0 5.205-2.162c-.337.042-.68.063-1.029.063-4.61 0-8.343-3.714-8.343-8.29 0-1.167.242-2.278.681-3.286z"></path>
                </svg>
                <span className="ball"></span>
              </label>
            </div>
            <button>Sign UP</button>
            <button>Login</button>
          </div>
        </nav>
      </div>
    </>
  );
};

export default Header;
